import{_ as o,o as t,c as s,e as r}from"./chunks/framework.78e651f5.js";const e="/assets/PROVODKA_12.55f0731b.jpg",n="/assets/PROVODKA_24.88896b05.jpg",p="/assets/PROVODKA_04.0a01aa0a.jpg",a="/assets/PROVODKA_05.220d6491.jpg",g="/assets/PROVODKA_11.36650f37.jpg",c="/assets/Proworking_plan-3-copy-2.cf0e2128.jpg",A=JSON.parse('{"title":"Проворкинг «PROVODKA»","description":"","frontmatter":{"title":"Проворкинг «PROVODKA»","date":"2015-11-23","icon":"logo.jpg","cover":"cover.jpg","address":"ул. Самокатная, 4с45","place":"Кристалл","city":"г. Москва","tel":"+7 (495) 361-34-11","email":"provodka@proworking.pro","url":"https://proworking.pro","coord":[55.75652808811811,37.67743905417032],"status":"closed"},"headers":[],"relativePath":"workshop/archive/provorking-provodka/index.md","filePath":"workshop/archive/provorking-provodka/index.md"}'),i={name:"workshop/archive/provorking-provodka/index.md"},_=r('<p><img src="'+e+'" alt=""><img src="'+n+'" alt=""></p><p>Первый проворкинг PROVODKA в Москве открылся 29 октября в строении №4 <strong>московского завода «Кристалл»</strong>. Инициатором создания проворкинга выступила команда <strong>проекта Про.Движение&gt;</strong>, под руководством Петра Виноградова, известная своими архитектурными фестивалями в городах России и СНГ, Про.Ёлкой в городе Выкса и <a href="/workshop/catalog/pro-dvizhenie/">мастерскими проекта Про.Движение, которые размещены в том же здании</a>.</p><p><strong>Проворкинг</strong> <em>[professional, productive working]</em> PROVODKA – это максимально удобное пространство для талантливых и профессиональных людей желающих с нуля реализовать собственные художественные проекты.</p><p><img src="'+p+'" alt=""><img src="'+a+'" alt=""><img src="'+g+'" alt=""></p><p>Сейчас PROVODKA начинает свою работу как <strong>общественный офис на 24 рабочих места</strong>. Резиденты могут пользоваться <strong>кухней</strong>, <strong>принт-центром</strong> с возможностью печати до А0, <strong>экраном и проектором</strong> для презентации своих проектов, <strong>переговорной зоной</strong> с красивым столом ручной работы на 10-12 мест, <strong>услугами</strong> там же расположенных конструкторского бюро Bulwark, архитектурной мастерской «Проектная группа А2» и нескольких <strong>дерево- и металлообрабатывающих художественных мастерских</strong>.</p><blockquote><p><em>«Здесь пространство людей, которые делают честные вещи. Наша концепция – зарабатывать не на людях, а вместе с ними, не на пространстве, а с помощью пространства.» Петр Виноградов</em></p></blockquote><p>В планах организаторов площадки запуск образовательных программ <strong>по проектированию</strong>, художественной <strong>металлообработке</strong>, истории русского искусства и созданию <strong>кинетических скульптур</strong>.</p><p><img src="'+c+'" alt=""></p>',8),d=[_];function l(m,O,k,h,v,P){return t(),s("div",null,d)}const V=o(i,[["render",l]]);export{A as __pageData,V as default};
